  return(
    <body style={{
      backgroundColor:'#BEBEBE',
    }}>
      <header style={{
        fixed:'top',
        }}>
        <h1>Yanami</h1>
      </header>
      <div style={{
        backgroundColor:'#BEBEBE'
        }}>
        <h1>Yanami</h1>
      </div>
    </body>
  );
}
